import React from 'react';
import './Addbar.css';
import styled from 'styled-components';

const Container=styled.div`
background-color:red
top:0;
`;

const Addbar = () => {
  return (
    <div>
        <Container>
      <div class="scrolling">
		<h2>Lorem ipsum dolor sit amet, consectetur adipisicing elit.</h2>
	</div>
    </Container>
    </div>
  );
}

export default Addbar;
